import { styled, Box } from "@mui/material";
import { Colors } from "../theme";



export const ParentContain = styled(Box)(()=> ({
    marginLeft:"auto",
    transition:"0.4s",
    
}))
export const DashboardContain = styled(Box)(()=> ({
    marginLeft:"auto",
    textAlign:"center",
    background:Colors.white,
    color:Colors.dim_grey,
    padding:"20px"
}))
